INSERT INTO `problem_info` VALUES (1,'PermCheck','A non-empty zero-indexed array A consisting of N integers is given.\n\nA permutation is a sequence containing each element from 1 to N once, and only once.\n\nFor example, array A such that:\n    A[0] = 4\n    A[1] = 1\n    A[2] = 3\n    A[3] = 2 \nis a permutation, but array A such that:\n    A[0] = 4\n    A[1] = 1\n    A[2] = 3 \nis not a permutation, because value 2 is missing.\n\nThe goal is to check whether array A is a permutation.\n\nWrite a function:\n\nint solution(int A[], int N);\n\n\nthat, given a zero-indexed array A, returns 1 if array A is a permutation and 0 if it is not.\n\nFor example, given array A such that:\n    A[0] = 4\n    A[1] = 1\n    A[2] = 3\n    A[3] = 2 \nthe function should return 1.\n\nGiven array A such that:\n    A[0] = 4\n    A[1] = 1\n    A[2] = 3 \nthe function should return 0.\n\nAssume that:\n\n N is an integer within the range [1..100,000];\n each element of array A is an integer within the range [1..1,000,000,000].\n\nComplexity:\n\n expected worst-case time complexity is O(N);\n expected worst-case space complexity is O(N), beyond input storage (not counting the storage required for input arguments).\n\nElements of input arrays can be modified.\n',120),(2,'MaxDoubleSliceSum','A non-empty zero-indexed array A consisting of N integers is given.\n\nA triplet (X, Y, Z), such that 0 ≤ X < Y < Z < N, is called a double slice.\n\nThe sum of double slice (X, Y, Z) is the total of A[X + 1] + A[X + 2] + ... + A[Y − 1] + A[Y + 1] + A[Y + 2] + ... + A[Z − 1].\n\nFor example, array A such that:\n    A[0] = 3\n    A[1] = 2\n    A[2] = 6\n    A[3] = -1\n    A[4] = 4\n    A[5] = 5\n    A[6] = -1\n    A[7] = 2 \ncontains the following example double slices:\n\n•double slice (0, 3, 6), sum is 2 + 6 + 4 + 5 = 17,\n•double slice (0, 3, 7), sum is 2 + 6 + 4 + 5 − 1 = 16,\n•double slice (3, 4, 5), sum is 0.\n\nThe goal is to find the maximal sum of any double slice.\n\nWrite a function:\n\nint solution(int A[], int N);\n\n\nthat, given a non-empty zero-indexed array A consisting of N integers, returns the maximal sum of any double slice.\n\nFor example, given:\n    A[0] = 3\n    A[1] = 2\n    A[2] = 6\n    A[3] = -1\n    A[4] = 4\n    A[5] = 5\n    A[6] = -1\n    A[7] = 2 \nthe function should return 17, because no double slice of array A has a sum of greater than 17.\n\nAssume that:\n\n•N is an integer within the range [3..100,000];\n•each element of array A is an integer within the range [−10,000..10,000].\n\nComplexity:\n\n•expected worst-case time complexity is O(N);\n•expected worst-case space complexity is O(N), beyond input storage (not counting the storage required for input arguments).\n\nElements of input arrays can be modified.\n',120),(3,'NumberSolitare','A game for one player is played on a board consisting of N consecutive squares, numbered from 0 to N − 1. There is a number written on each square. A non-empty zero-indexed array A of N integers contains the numbers written on the squares. Moreover, some squares can be marked during the game.\n\nAt the beginning of the game, there is a pebble on square number 0 and this is the only square on the board which is marked. The goal of the game is to move the pebble to square number N − 1.\n\nDuring each turn we throw a six-sided die, with numbers from 1 to 6 on its faces, and consider the number K, which shows on the upper face after the die comes to rest. Then we move the pebble standing on square number I to square number I + K, providing that square number I + K exists. If square number I + K does not exist, we throw the die again until we obtain a valid move. Finally, we mark square number I + K.\n\nAfter the game finishes (when the pebble is standing on square number N − 1), we calculate the result. The result of the game is the sum of the numbers written on all marked squares.\n\nFor example, given the following array:\n    A[0] = 1\n    A[1] = -2\n    A[2] = 0\n    A[3] = 9\n    A[4] = -1\n    A[5] = -2 \none possible game could be as follows:\n\n•the pebble is on square number 0, which is marked;\n•we throw 3; the pebble moves from square number 0 to square number 3; we mark square number 3;\n•we throw 5; the pebble does not move, since there is no square number 8 on the board;\n•we throw 2; the pebble moves to square number 5; we mark this square and the game ends.\n\nThe marked squares are 0, 3 and 5, so the result of the game is 1 + 9 + (−2) = 8. This is the maximal possible result that can be achieved on this board.\n\nWrite a function:\n\nint solution(int A[], int N);\n\n\nthat, given a non-empty zero-indexed array A of N integers, returns the maximal result that can be achieved on the board represented by array A.\n\nFor example, given the array\n    A[0] = 1\n    A[1] = -2\n    A[2] = 0\n    A[3] = 9\n    A[4] = -1\n    A[5] = -2 \nthe function should return 8, as explained above.\n\nAssume that:\n\n•N is an integer within the range [2..100,000];\n•each element of array A is an integer within the range [−10,000..10,000].\n\nComplexity:\n\n•expected worst-case time complexity is O(N);\n•expected worst-case space complexity is O(N), beyond input storage (not counting the storage required for input arguments).\n\nElements of input arrays can be modified.',120);
